import React from "react";
import styled from "styled-components";
import NavBarScroll from "../components/NavBarScroll";
import DichVuBackGround from "../assets/dich-vu-background.jpeg";
import Dichvu from "../components/Dichvu";
import Footer from "../components/Footer";
export default function Service() {
    return (
        <>
            <FormContainer>
                <div className="navbar-top-space">
                    <NavBarScroll />
                </div>
                <div className="header-space" style={{ backgroundImage: `url(${DichVuBackGround})` }}>
                    <h1 style={{ color: "#fff", textAlign: "center" }}>DỊCH VỤ</h1>
                </div>
                <div className="items-space">
                    <Dichvu />
                </div>
                <div></div>
                <footer className="footer-space">
                    <Footer />
                </footer>
            </FormContainer>
        </>
    )
}

const FormContainer = styled.div`
height: 100vh;
width: 100vw;
display: flex;
flex-direction: column;
align-items: center;
gap: 1rem;
background-color: #fff;
.navbar-top-space{
    height: 5vh;
    width: 100vw;
    display: block;
    top: 0;
    z-index: 999;
}
.header-space{
    width: 100vw;
    height: 30vh;
    padding-top: 15vh;
    padding-bottom: 15vh;
}
.items-space{
    width: 100vw;
    height: 120vh;
    display:block;
}
.footer-space{
    width: 100vw;
    height: 70vh;
    display:block;
    background-color: #333;
    color: #fff;
}
`;
